$.validator.addMethod("personnummer",function(a){if(0==a.length)return!0;var a=a.replace("-",""),e=parseInt(a.substr(9,1),10);if(12==a.length)a=a.substr(2,9);else if(10==a.length)a=a.substr(0,9);else return!1;for(var c=0,d=0;d<a.length;d++){var b=parseInt(a.substr(d,1),10);0==d%2&&(b*=2);c=9<b?c+(1+b%10):c+b}return 0==(e+c)%10});